const Nav = () => {
    return <nav className='nav'> {/* nav - тэг, определяющий набор навизационных ссылок */}
    <div><a>Profile</a></div>
    <div><a>Messages</a></div>
    <div><a>News</a></div>
    <div><a>Music</a></div><br></br>
    <div><a>Settings</a></div>
  </nav>
}


export default Nav;
